import {Component} from '@angular/core';

@Component({
  selector: 'app-not-found',
  templateUrl: './not-found.component.html',
  styleUrls: ['./not-found.component.scss'],
})
export class NotFoundComponent {}
<ion-content [fullscreen]="true">
  <h1><b>404</b>: {{ '404.title' | transloco }}</h1>
  <p>{{ '404.doesNotExist' | transloco }}</p>
  <p>{{ '404.errorLogged' | transloco }}</p>

  <ion-button color="primary" routerLink="/translate">
    {{ '404.goHome' | transloco }}
  </ion-button>
</ion-content>
